/**
 * Construct from (U.S.) x,y,z coordinates.
 *@param x is the x value.
 *@param y is the y value.
 *@param z is the z value.
 */
public Vector(double x, double y, double z) {
  this.x = x;
  this.y = y;
  this.z = z;
}

